import Header from "../components/Header";
import Footer from "../components/Footer";

function Tkani() {
  return (
    <div className="wrapper">
      <Header cartPrice={2120} />
      <div className="tkani__main"></div>
      <Footer />
    </div>
  );
}

export default Tkani;
